			headers: { 'content-type': 'application/x-www-form-urlencoded' },
			data: qs.stringify(data),
			url,
		};
		axios(options);*/
		this.setState({ sent: false });
	}
	servicesForm() {
		const restaurants = [{
			name: "Pizza Hut",
			fee: "$0.50",
			miles: 2,
		},
		{
			name: "Taco Bell",
			fee: "$0.80",
			miles: 7,
		}];
		return (<>
			{
				restaurants.map((data) => {
					return (
						<button onClick={(e) => this.submit()}>
							<div>
								<h6>{data.name}</h6>
								<br />
								<small>{data.fee} Delivery Fee</small>
								<br />
								<small>{data.miles} Miles</small>
							</div>
						</button>);
				})
			}
		</>);
	}
	b() {
		return (
			<div>
				<p>Service request submitted.</p>
				<ShowMenu />
			</div>
		);
	}
}
export default App;
